import React from "react";
import Shifter from "./Shifter";

const Items = (props) => {
  if (props.data.length === 0) {
    return;
  }

  return (
    <ul>
      {props.data.map((shifter) => {
        console.log(shifter.time);
        console.log(shifter.employee);
      })}
    </ul>
  );
};

export default Items;
